begin
for i in
(
select
cc.matriz,
cc.filial,
cc.regional,
cc.unidade,
v.vehicle_id,
v.description as modelo,
V.Vehicle_Year As Ano,
v.vehicle_plates as placa,
v.vehicle_prefix as prefixo,
v.embeded_fences_limit,
regexp_replace(i.imei,'_\w+','') equip,
regexp_replace(i.imei,'\w+_','') did
from aero.vehicles v
left join aero.vehicle_imei i on i.vehicle_id=v.vehicle_id
left join aero.active_customers_hierarchy cc on cc.customer_child_id = v.customer_child_id
where v.vehicle_status in (1)
--and UPPER(cc.matriz) like '%BRACELL%'
AND I.IMEI LIKE 'VIRCOM5_%'
--AND v.DESCRIPTION LIKE '%3344'
AND regexp_replace(i.imei,'\w+_','') IN ('H0E9','H0EB','H0E7','H0E8')
--and v.vehicle_plates in ('QPW3257','FQO5H43','DVC9H83','CUI8C78','FPI4B25','FDP1F98','BSY2F46','DMN6C07','FRO8F25','QIX-5171','FVT6J65','FNM4H42','FOV3D35','BYQ7H08','QIX-4861','FIL5J21','FCD4J32','CPN0I17','EEM4I62','BTY4E51','CUL0F93','CCX6G21','QIX-2561')
)
loop
end loop;
end;
